"   </div>",
"   <div class=\"lgnd\">",
"    The latissimus dorsi flap is a reliable option for autologous tissue reconstruction. The flap is tunneled through the axilla, leaving its vascular pedicle, the thoracodorsal artery and vein, intact. Because the LD is not a bulky flap, it usually is used in combination with a saline or silicone implant to provide sufficient breast volume and projection.",
