"   </div>",
"   <div class=\"lgnd\">",
"    Major mechanisms of passive Na+ entry into the cells across the luminal (apical) membrane in the different nephron segments. With the exception of the selective Na+ channels in the collecting tubules, Na+ reabsorption in the more proximal segments is linked to the reabsorption or secretion of other solutes.",
"    <div class=\"footnotes\">",
