var script_f42_6_43117=[""].join("\n");
var outline_f42_6_43117=null;
var title_f42_6_43118="FDA label ex pharmacogen";
var content_f42_6_43118=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F65875&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F65875&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Various genomic biomarkers in the context of US Food and Drug Administration (FDA)-approved drug labels",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Biomarker",
"       </td>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Synopsis of drug label information",
"       </td>",
"       <td class=\"subtitle1\">",
"        Label recommends testing prior to instituting therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ALK (anaplastic lymphoma kinase) gene rearrangements",
"       </td>",
"       <td>",
"        Crizotinib",
"       </td>",
"       <td>",
"        Crizotinib selectively inhibits ALK tyrosine kinase. ALK gene rearrangements, which include the echinoderm microtubule-associated protein-like 4-AKL (EML4-ALK) fusion oncogene, may result in expression of oncogenic fusion proteins and increased tumor growth. Detection of ALK-positive NSCLC is necessary for selection of patients for treatment with crizotinib.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        BRAF",
"        <sup>",
"         V600",
"        </sup>",
"        , BRAF",
"        <sup>",
"         V600E",
"        </sup>",
"        mutations",
"       </td>",
"       <td>",
"        Vemurafenib",
"       </td>",
"       <td>",
"        Vemurafenib inhibits BRAF kinase, which inhibits tumor growth in melanomas that have specific types of mutated BRAF at the V600 site. Confirmation of a V600 BRAF mutation is required for selection of patients for treatment of melanoma with vemurafenib.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        c-KIT expression",
"       </td>",
"       <td>",
"        Imatinib",
"       </td>",
"       <td>",
"        Imatinib inhibits proliferation and induces apoptosis in gastrointestinal stromal tumors (GIST) cells that express an activating c-KIT mutation.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        CCR5 (Chemokine C-C motif receptor 5)",
"       </td>",
"       <td>",
"        Maraviroc",
"       </td>",
"       <td>",
"        Maraviroc is indicated for treatment-experienced adult patients infected with only CCR5-tropic strains of HIV-1 that are resistant to multiple antiretroviral agents.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Cystic fibrosis transmembrane conductance regulator (CFTR) gene, G551D mutation",
"       </td>",
"       <td>",
"        Ivacaftor",
"       </td>",
"       <td>",
"        Ivacaftor is indicated for treatment of patients with cystic fibrosis who harbor a G551D mutation in at least one of their CFTR genes.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Cytochrome P450 (CYP) 2C19 variants",
"       </td>",
"       <td>",
"        Clopidogrel",
"       </td>",
"       <td>",
"        Patients with genetically reduced CYP2C19 function have lower systemic exposure to the active metabolite of clopidogrel, diminished antiplatelet response, and higher cardiovascular event rates following myocardial infarction than do patients with normal CYP2C19 function.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Voriconazole",
"       </td>",
"       <td>",
"        CYP2C19 is significantly involved in the metabolism of voriconazole; poor metabolizers have on average four-fold higher voriconazole exposure than their homozygous counterparts.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Citalopram",
"       </td>",
"       <td>",
"        Maximum recommended daily dose of 20 mg (rather than 40 mg) for CYP2C19 poor metabolizers.&nbsp;&nbsp;",
"       </td>",
"       <td>",
"        &nbsp;No",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        CYP2C9 variants",
"       </td>",
"       <td>",
"        <p>",
"         Warfarin",
"        </p>",
"        <p>",
"         For additional information on warfarin see below",
"        </p>",
"       </td>",
"       <td>",
"        Increased bleeding risk for patients carrying either the CYP2C9*2 or CYP2C9*3 allele.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Celecoxib",
"       </td>",
"       <td>",
"        CYP2C9 poor metabolizers may have abnormally high plasma levels due to reduced metabolic clearance.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        CYP2D6 variants",
"       </td>",
"       <td>",
"        Atomoxetine",
"       </td>",
"       <td>",
"        Patients with reduced activity in this pathway (poor metabolizers) have higher plasma concentrations of atomoxetine compared to people with normal activity (extensive metabolizers).",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fluoxetine",
"       </td>",
"       <td>",
"        CYP2D polymorphisms of the poor metabolizer phenotype do not affect the metabolism of fluoxetine because of compensatory mechanisms. However, fluoxetine inhibits the activity of the 2D6 isoenzyme and it may affect the metabolism of other drugs that are metabolized with this enzyme, potentially making normal metabolizers resemble poor metabolizers. Drugs that are predominantly metabolized by CYP2D6 that have a relatively narrow therapeutic index (example tricyclic antidepressants) should be initiated at the low end of the dose range if concomitant fluoxetine is being used.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Codeine",
"       </td>",
"       <td>",
"        Some individuals may be ultra-rapid metabolizers due to a specific CYP2D6* genotype; these individuals convert codeine into its active metabolite, morphine, more rapidly and completely than other people. This rapid conversion results in higher than expected serum morphine levels.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tetrabenazine",
"       </td>",
"       <td>",
"        Patients without expression of CYP2D6 drug metabolizing enzyme likely to have increased exposure.",
"       </td>",
"       <td>",
"        Yes, if daily doses &gt;50 mg",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Deletion of chromosome 5q(del(5q))",
"       </td>",
"       <td>",
"        Lenalidomide",
"       </td>",
"       <td>",
"        Indicated for the treatment of myelodysplastic syndrome in patients with deletion 5q cytogenetic abnormality with transfusion dependent anemia.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Dihydropyrimidine dehydrogenase (DPD) deficiency",
"       </td>",
"       <td>",
"        Fluorouracil, capecitabine",
"       </td>",
"       <td>",
"        Unexpected, severe toxicity (eg, stomatitis, diarrhea, neutropenia, and neurotoxicity) associated with these drugs has been attributed to a deficiency of DPD activity.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Familial hypercholesterolemia",
"       </td>",
"       <td>",
"        Atorvastatin",
"       </td>",
"       <td>",
"        Dose adjustment is needed in pediatric patients (age 10 to 17) with homozygous familial hypercholesterolemia.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Glucose-6-phosphate dehydrogenase (G6PD) deficiency",
"       </td>",
"       <td>",
"        Rasburicase, dapsone, primaquine, chloroquine",
"       </td>",
"       <td>",
"        These drugs administered to patients with glucose-phosphate dehydrogenase (G6PD) deficiency can cause severe hemolysis.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        HER2 overexpression",
"       </td>",
"       <td>",
"        Trastuzumab, lapatinib",
"       </td>",
"       <td>",
"        Over-expression of HER2/neu necessary for selection of patients who are appropriate for use of these agents.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        HLA-B*1502 allele presence",
"       </td>",
"       <td>",
"        Carbamazepine",
"       </td>",
"       <td>",
"        Serious dermatologic reactions can result in individuals with the HLA-B*1502 allele.",
"       </td>",
"       <td>",
"        Yes (in patients of Asian descent)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        HLA-B*5701 allele presence",
"       </td>",
"       <td>",
"        Abacavir",
"       </td>",
"       <td>",
"        Hypersensitivity reactions, lactic acidosis, and severe hepatomegaly can occur in patients who carry the HLA-B*5701 allele at high risk for such reactions to abacavir; screening for this allele is recommended prior to initiating treatment with abacavir.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        KRAS mutation",
"       </td>",
"       <td>",
"        Panitumumab, cetuximab",
"       </td>",
"       <td>",
"        Use of these drugs is not recommended for the treatment of patients with colorectal cancer who have mutated KRAS in their tumors.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Arylamine N-acetyltransferase (NAT) variants",
"       </td>",
"       <td>",
"        Rifampin, isoniazid, pyrazinamide, isosorbide dinitrate, hydralazine hydrocloride",
"       </td>",
"       <td>",
"        Slow acetylation may lead to higher blood levels of these drugs and thus, an increase in toxic reactions.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Philadelphia chromosome positivity",
"       </td>",
"       <td>",
"        Busulfan",
"       </td>",
"       <td>",
"        This drug is clearly less effective in patients with chronic myelogenous leukemia (CML) who lack the Philadelphia (Ph1) chromosome.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dasatinib",
"       </td>",
"       <td>",
"        Indicated for the treatment of adults with Philadelphia chromosome-positive acute lymphoblastic leukemia (ALL) with resistance or intolerance to prior therapy.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        PML/RAR alpha gene expression (retinoic acid receptor) expression",
"       </td>",
"       <td>",
"        Tretinoin, arsenic trioxide",
"       </td>",
"       <td>",
"        Indicated for treatment of acute promyelocytic leukemia (APL) characterized by a t(15,17) translocation and/or the presence of PML/RAR alpha gene. The response rate of other APML subtypes has not been demonstrated and therefore, patients who lack this genetic marker should be considered for alternative treatment.",
"       </td>",
"       <td>",
"        Yes, if no t(15,17)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Protein C deficiency (hereditary or acquired)",
"       </td>",
"       <td>",
"        <p>",
"         Warfarin",
"        </p>",
"        <p>",
"         For additional information on warfarin see above and below",
"        </p>",
"       </td>",
"       <td>",
"        Hereditary or acquired deficiencies of protein C or its cofactor protein S have been associated with tissue necrosis following drug administration.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Thiopurine methyltransferase (TPMT) variants",
"       </td>",
"       <td>",
"        Azathioprine, 6-mercaptopurine, thioguanine",
"       </td>",
"       <td>",
"        Individuals with TPMT deficiency or lower activity due to mutation are at increased risk for myelotoxicity.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Uridine diphospho- glucuronosyltransferase 1A1 (UGT 1A1) variants",
"       </td>",
"       <td>",
"        Irinotecan",
"       </td>",
"       <td>",
"        Patients exposed to this drug who have the UGT1A1*28 allele may be more susceptible to toxicity.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nilotinib",
"       </td>",
"       <td>",
"        Can increase bilirubin levels; the (TA)7/(TA)7 genotype (UGT1A1*28 allele) is associated with a statistically significant increase in the risk of hyperbilirubinemia.",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Urea cycle disorder (UCD) deficiency",
"       </td>",
"       <td>",
"        Valproic acid",
"       </td>",
"       <td>",
"        Use is contraindicated in individuals with urea cycle disorder. Evaluation for UCD prior to therapy should be considered for patients in certain high risk groups including those with family history of UCD.",
"       </td>",
"       <td>",
"        Yes for patients with history of unexplained encephalopathy or coma, unexplained mental retardation, cyclical vomiting and lethargy, history of elevated ammonia or glutamine, family history of UCD, or unexplained infant deaths.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Vitamin K epoxide reductase (VKORC1) variants",
"       </td>",
"       <td>",
"        <p>",
"         Warfarin",
"        </p>",
"        <p>",
"         For additional information on warfarin see above",
"        </p>",
"       </td>",
"       <td>",
"        Certain single nucleotide polymorphisms in the VKORC1 gene (especially the -1639G&gt;A allele) have been associated with lower dose requirements for warfarin.",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
